          <h4>Grid and column UI Design</h4>
          <p className="App-para0">Public</p>
          </div>

          <div className="App-para">
          <img src={dot2} alt="dot1" height={10} width={10} />
          <p className="App-semi-para">CSS Updated 12 hours ago</p>
          </div>

          <div className="App-para2">
          <img src={dot4} alt="dot1" height={15} width={15} />
          <p className="App-mini-para">Star</p>
          <img className="App-img" src={dot5} alt="dot1" height={7} width={7} />
          </div>
        </div>

        </div>
      </div>
    </div>































